import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state={
    list:[]
  }
  componentDidMount(){
    fetch('http://localhost:3000')
    .then(res=>res.json())
    .then((data)=>{
      this.setState({list:data}, ()=>{
        console.log(this.state.list)
      })
    })
  }
  render() {
    return (
      <div className="App">
       <ul>
      {this.state.list.map((ctc,i)=>{
        <li>ctc.name</li>
      })}
       </ul>
      </div>
    );
  }
}

export default App;
